import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import Header from "./AppBar"

function App() {
  return (
    <Router>
        <Route exact path='/' component={Header}></Route>
    </Router>
  );
}

export default App;
